import logo from './logo.svg';
import './App.css';
import React from 'react';
import axios from "axios";
import { useEffect } from 'react';
import { useState } from 'react';
import { response } from 'express';

function App() {
  const [items,setItems]=useState([]);
  useEffect(()=>{
    axios.get("http://localhost:3000")
    .then((response)=>{
      setItems(response.data);
    })
    .catch((error)=>{
      console.log(error);
    })
  })
  return (
    <div>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
  <div class="container-fluid">
    <a class="navbar-brand" href="#">items.home</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav me-auto mb-2 mb-lg-0">
        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="#">items.settings</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">items.help</a>
        </li>

        <li class="nav-item">
          <a class="nav-link disabled">Disabled</a>
        </li>
      </ul>
      <form class="d-flex">
        <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button class="btn btn-outline-success" type="submit">items.search</button>
      </form>
    </div>
  </div>
</nav>
    </div>
  );
}

export default App;
